(function($) {
  jQuery.fn.exists = function () {
    return this.length !== 0;
  };

  jQuery.fn.slider_jml = function(options) {

  	var sliderOptions = {
  		currentSlide: 0,
      slideType: "linear"
  	};

  	var mainWrapper = {
  		height: "100%",
  		width: "100%",
  		margin: "0px auto",
  		position: "relative",
  		textAlign: "left",
  		zIndex: "100",
  		outline: "none",
  		padding: "0px",
  		verticalAlign: "baseline",
  		overflow: "hidden"
  	};

  	var ulTagCss = {
  		ul: {
  			listStyle: "none",
	  		display: "table",
	  		margin: "0px",
        position: "absolute",
        zIndex: "100",
        left: "0px"
  		},
  		li: {
  			display: "table-cell",
  			"float": "none",
  			width: "100%",
  			height: "100%"
  		}
  	};

  	var circlImg = "url(data:image/png;base64,)";

  	var olTagCss = {
  		ol: {
  			listStyle: "none",
	  		display: "table",
	  		margin: "0px",
	  		position: "absolute",
	  		bottom: "46px",
	  		left: "174px",
	  		display: "table",
	  		zIndex: "403"
  		},
  		li: {
  			display: "table-cell",
  			"float": "none"
  		},
      span:{
        display: "table-cell",
        "float": "none",
        backgroundImage: circlImg,
        backgroundRepeat: "no-repeat",
        width: "14px",
        height: "11px"
      }
  	}

    var h1Css = {
      fontFamily: "'Tinos', serif",
      fontSize: "2.8em",
      color: "#fff",
      fontWeight: "normal"
    };

    var contentCss = {
      position: "absolute",
      zIndex: "300",
      width: "40%",
      left: "13.2%",
      top: "45%",
      display: "none"
    };
  	
  	mainWrapper = jQuery.extend(mainWrapper, options.css.mainWrapper);
  	sliderOptions = jQuery.extend(sliderOptions, options.sliderOptions);
    var main = jQuery(this);
    var mainId = jQuery(main).attr("id");
    
    // check if there is ul element, if not send error
    var ulObj = null;
    ulObj = jQuery(main).find("ul");
    if( ! jQuery(ulObj).exists() ){ alert("No UL tag found"); return false; }

    jQuery(ulObj).css(ulTagCss.ul).children().css(ulTagCss.li);

    // add nav and modify content
    jQuery(main).append("<ol id='jml_nav_"+mainId+"'></ol>");
    var navObj = jQuery("#jml_nav_"+mainId);
    var leftPos = 0;
    jQuery(ulObj).children().each(function(){

      jQuery(navObj).append("<li leftpos='"+ jQuery(ulObj).find("li:eq("+ jQuery(this).index() +")").offset().left +"'><a href='javascript:void(0);' style='text-decoration:none;'><span>&nbsp;</span></a></li>");
    	
      if( sliderOptions.currentSlide == jQuery(this).index() )
      {
        jQuery(navObj).find("li:eq("+ jQuery(this).index() +") span").css({ backgroundPosition: "-14px 0px" });
      }
    	
    });
    // apply css to nav
    jQuery(navObj).css(olTagCss.ol);
    jQuery(navObj).children().find("span").css(olTagCss.span);
    jQuery(navObj).children().css(olTagCss.li).bind("click", function(){

      fireSelect(this);

    });



    jQuery(main).css(mainWrapper);

    // ad shadow effect
    var shadowCss = {
      position: "absolute",
      top: "0px",
      left: "0px",
      width: jQuery(main).width(),
      height: jQuery(main).height(),
      zIndex: "290",
      backgroundImage: "url(data:image/png;base64,)",
      backgroundPosition: "left center",
      backgroundRepeat: "no-repeat"
    };

    jQuery(main).prepend("<div id='jml_shadow_"+mainId+"'></div>");
    var shadowObj = jQuery("#jml_shadow_"+mainId);
    jQuery(shadowObj).css(shadowCss);

    
    // load the user selected content
    function fireSelect(obj){
      
      var i = jQuery(obj).index();
      var l = jQuery(obj).attr("leftpos");


      fireAnimate(l, obj);

      fireRenderCaption(obj);

      fireClearCurrent();
      jQuery(obj).find("span").css({ backgroundPosition: "-14px 0px" });

    }

    // clear current
    function fireClearCurrent(){
      jQuery(navObj).children().find("span").css({ backgroundPosition: "0px 0px" });
    }

    // animate
    function fireAnimate(l, obj){
      if( sliderOptions.slideType == 'fade' )
      {
        jQuery(ulObj).fadeOut(400, function(){
          jQuery(ulObj).css({ left:(l * -1) + "px" });
        });
        jQuery(ulObj).fadeIn(300);
      }
      else
      {
        jQuery(ulObj).animate({ left: (l * -1) + "px" }, { queue: false, duration: 500 });
      }
    }

    // render caption
    function fireRenderCaption(obj){

      if(jQuery("#jml_slidecontent_"+mainId+"").exists())
      jQuery("#jml_slidecontent_"+mainId+"").remove();


      jQuery(main).append("<div id='jml_slidecontent_"+mainId+"'><h1>"+ jQuery(ulObj).find("li:eq("+ jQuery(obj).index() +")").find("img").attr("title") +"</h1></div>");
      var contentObj = jQuery("#jml_slidecontent_"+mainId+"");
      jQuery(contentObj).find("h1").css(h1Css);
      jQuery(contentObj).css(contentCss);
      jQuery(contentObj).append("<ul id='jml_buttononslide_"+mainId+"'><li>&nbsp;</li><li><a href='"+ jQuery(ulObj).find("li:eq("+ jQuery(obj).index() +")").find("img").attr("link") +"'>"+ jQuery(ulObj).find("li:eq("+ jQuery(obj).index() +")").find("img").attr("button") +"</a></li><li>&nbsp;</li></ul>");
      jQuery("#jml_buttononslide_"+mainId).css({
        display: "block", margin: "0px", padding: "0px", listStyle: "none", marginLeft: "30%", marginTop: "2%"
      });
      jQuery("#jml_buttononslide_"+mainId).find("a").css({
          textDecoration: "none", color: "white", fontFamily: "'Tinos', serif"
      });
      jQuery("#jml_buttononslide_"+mainId).children().css({ 
        backgroundRepeat: "no-repeat",
        height: "62px"
       });
      jQuery("#jml_buttononslide_"+mainId).find("li:eq(0)").css({ 
        "float": "left",
        backgroundImage: "url(data:image/png;base64,)",
        width: "28px",
        backgroundPosition: ""

         });
      jQuery("#jml_buttononslide_"+mainId).find("li:eq(1)").css({ 
        "float": "left",
        backgroundImage: "url(data:image/png;base64,)",
        minWidth: "20px",
        backgroundPosition: "",
        backgroundRepeat: "repeat-x",
        fontSize: "1.7em",
        lineHeight: "2.28em"
         });
      jQuery("#jml_buttononslide_"+mainId).find("li:eq(2)").css({ 
        "overflow": "hidden",
        backgroundImage: "url(data:image/png;base64,)",
        width: "52px",
        backgroundPosition: ""

         });


      setTimeout(function(){ jQuery(contentObj).fadeIn(500); }, 700);

    }


    fireSelect(jQuery(navObj).find("li:eq("+ sliderOptions.currentSlide +")"));

  };

})(jQuery);